import Footer from './Components/Footer';
import Header from './Components/Header';
import faker from 'faker'

function App() {
  return (
    <div>
      <Header /> 
       <img className="m-2 w-full h-2/4" src = {faker.image.image()} alt="back"/>
      <Footer />
    </div>
  );
}

export default App;
